package org.lqf.learn.leetCode.stackAndQueue.findAnagrams_438;

import java.util.*;

public class Solution {
    public static void main(String[] args) {
        //String s = "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa" +
         //         "baaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa";
        //String p = "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaa";
//        String s = "" +
//                   "";
//        String p = "";
        String s = "cbaebabacd";
        String p = "abc";
        System.out.println(findAnagrams(s,p));
    }
    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> res = new ArrayList<>();
        int s_len = s.length();
        int p_len = p.length();
        if(s_len == 0|| p_len == 0) {
            return Collections.emptyList();
        }
        Map<Character,Integer> dictMap = new HashMap<>();
        for(int i=0;i<p_len;i++) {
            char c = p.charAt(i);
            dictMap.put(c,dictMap.getOrDefault(c,0)+1);
        }
        int required = dictMap.size();
        int formed = 0;
        Map<Character,Integer> windowMap = new HashMap<>();
        int left = 0,right = 0;
        while (right < s_len) {
            char c = s.charAt(right);
            if(!dictMap.containsKey(c)) {
                left = right+1;
                right++;
                formed = 0;
                windowMap.clear();
                continue;
            }
            windowMap.put(c,windowMap.getOrDefault(c,0)+1);
            if(windowMap.containsKey(c) && windowMap.get(c).equals(dictMap.get(c)) ) {
                formed++;
            }
            if(windowMap.containsKey(c) && windowMap.get(c) > dictMap.get(c) ) {
                left = left+1;
                right = left;
                formed = 0;
                windowMap.clear();
                continue;
            }
            if(formed == required) {
                res.add(left);
                formed = 0;
                left++;
                right=left;
                windowMap.clear();
                continue;
            }
            right++;
        }
        return res;
    }
}
